import '../../App.css';


const Contact = () => {
	return (
		<div className="pages">			
			<h1 id="contactHeader">contact</h1>
			<ul id="contactList">
				<li>
					<a href="mailto:pressuresensitive1989@gmail.com">
					email
					</a>
				</li>
				<li>bandcamp</li>
				<li>facebook</li>
			</ul>
  		</div>
	);
}

export default Contact;
